v8:item.v8:content:
Для налогоплательщиков, являющихся в течение всего налогового периода организациями - собственниками объектов Единой системы газоснабжения и (или) организациями, в которых непосредственно и (или) косвенно участвуют собственники объектов Единой системы газоснабжения и суммарная доля такого участия составляет более 50 процентов, за исключением следующих налогоплательщиков:
налогоплательщиков - организаций, в которых одним из участников с долей не менее 50 процентов является российская организация, в которой непосредственно и (или) косвенно участвуют собственники объектов Единой системы газоснабжения и суммарная доля такого участия составляет менее 10 процентов;
налогоплательщиков, для которых рассчитываемый по итогам налогового периода коэффициент, характеризующий долю добытого газа горючего природного (за исключением попутного газа) в суммарном объеме добытого углеводородного сырья (Кгпн), составляет менее 0,35. Значение коэффициента Кгпн   определяется в соответствии с пунктом 6 настоящей статьи 342.4 НК РФ
